import React from 'react'
import { fontSizer, getCols, } from '../utils/utils'

class Header extends React.PureComponent {
    render = () => {
        return (
            <header className="header">


                <style jsx>{`
                    .header {
                        width: 100%;
                        height: 100%;
                    }
                `}</style>
            </header>
        )
    }
}

export default Header
